import React from "react";

function Table(props){
  //console.log(props.data[1][0]);
  //console.log(props.data[1][1]);


  return (
    <div>
      <table>
        <thead>
          <tr>
            {props.data[0].map((item, index) => {
              return <th>dfgds</th>;
            })}
          </tr>
        </thead>
        <tbody>
          {props.data.slice(0, props.data.length).map((item, index) => {
            return (
              <tr>
                <td>{item[0]}</td>
                <td>{item[1]}</td>
              </tr>
            );
          })}
        </tbody>
      </table>
    </div>
  );
}

export default Table;
